import { Table, Row, Col, Container, Button } from "react-bootstrap";
import Clinic from "./Clinic";
import "./Clinic.css";
import { useContext } from "react";
import { DataContext } from "../../Data/DataContext";
function Tr(props) {
  const [
    nav,
    setNav,
    admin,
    setAdmin,
    user,
    setUser,
    clincs,
    setClinic,
    ads,
    setAds,
    userModal,
    setUserModal,
  ] = useContext(DataContext);

  const deleteRow = (id) => {
    alert(id);
  };

  const editRow = (id) => {
    setUserModal(true);
    const user = user.filter((user) => user.id === id);
    console.log(user);
  };
  return (
    <tr>
      <th>#</th>
      <th>{props.name}</th>
      <th>{props.phone}</th>
      <th>{props.email}</th>
      <th>{props.city}</th>
      <th>{props.account}</th>
      <th>{props.date}</th>
      <th>
        <Button
          variant="outline-primary"
          size="sm"
          onClick={() => editRow(props.delete)}
        >
          Edit
        </Button>
      </th>
      <th>
        <Button
          onClick={() => deleteRow(props.delete)}
          variant="outline-primary"
          size="sm"
        >
          Delete
        </Button>
      </th>
    </tr>
  );
}

export default Tr;
